import { useEffect, useRef, useState } from 'react';
import { View, Text, PermissionsAndroid, TouchableOpacity, Dimensions, StyleSheet } from 'react-native'
import RNHTMLtoPDF from 'react-native-html-to-pdf';
import { FileSystem } from 'react-native-file-access'
import PDF from 'react-native-pdf'
import Icon from 'react-native-vector-icons/Ionicons'
import Loading from '../components/loading'
import MaskInput , { Masks } from 'react-native-mask-input'

import ExecuteQuery from '../sql/index'

export default function ReportServices() {
  
  const dataAtual = new Date()
  const[localPath, setLocalPath] = useState(null)
  const[pdfView, setPdfView] = useState(false)
  const[loading, setLoading] = useState(false)
  const[dados, setDados] = useState([])
  const[hoje, setHoje] = useState()
  const[dtIniFilter, setDtIniFilter] = useState('')
  const[dtEndFilter, setDtEndFilter] = useState('')
  const[gerarPDF, setGerarPDF] = useState(false)
  const refDtend = useRef(null)

  useEffect(()=>{
    if(gerarPDF)
      createPDF()
  },[gerarPDF])

  function atualizaData() {
    const diaAtual = dataAtual.getDate()
    const mesAtual = dataAtual.getMonth() +1
    const anoAtual = dataAtual.getFullYear()
    setHoje(`${diaAtual}/${mesAtual}/${anoAtual}`)
  }

  function converteData(data) {
    const dataOld = data.split('/')
    const dataNew = new Date(parseInt(dataOld[2], 10), parseInt(dataOld[1], 10) - 1, parseInt(dataOld[0], 10))
    return dataNew
  }

  async function filtrar(){
    setLoading(true)
    atualizaData()
    
    const filter = await ExecuteQuery("SELECT * FROM hrextras ")
    let temp = []
    for(i = 0; i < filter.rows.length; i++){
      temp.push(filter.rows.item(i))
    }
    // console.log(temp)

    if(dtIniFilter !== "" && dtEndFilter !== ""){
      let dataInicial = converteData(dtIniFilter)
      let dataFinal = converteData(dtEndFilter)
      let objetosFiltrados = temp.filter(result => {
        return converteData(result.data) >= dataInicial && converteData(result.data) <= dataFinal
      })
      setDados(objetosFiltrados)
      
      console.log(objetosFiltrados)
    }else setDados([...temp])
    setGerarPDF(true)
    
  }

  function Limpar() {
    setDtIniFilter('')
    setDtEndFilter('')
    setGerarPDF(false)
  }
  
  async function createPDF(){
    Limpar()
    const html = `
      <html>
      <head>
        <style>
          body {
            margin: 0;
            padding: 0;
          }
          hr.single {
            border: 1px solid black;
            margin: 1px;
          }
          hr.double {
            border: 2px solid black;
            margin: 1px;
          }
          .logo {
            width: 120px;
            height: 120px;
            padding: 0;
          }

          .cab {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin: 10px;
          }

          .titleCab {
            text-align: center;
            margin-top: 0;
          }
          .textTitle {
            font-size: 2rem;
            margin: 0;
            padding: 0;
          }
          .textTitle2 {
            margin: 0;
          }
          .titleReport {
            font-size: 1.5rem;
            margin: 20px 0 0 0;
            padding: 10px;
            background-color: rgb(220,220,220);
          }

          table {
            margin-top: 20px;
            width: '100%';
          }
          .item {
            text-align: center;
            margin: 0;
            border-bottom: 1px solid #aaa;
          }
          th {
            border-bottom: 2px solid black;
            padding-bottom: 20px;
          }
          td {
            padding-bottom: 5px;
          }

        </style>
      </head>
      <body>
        <header>
          <div class="cab">
            <img src="data:image/png;base64," class="logo"/>
            <div class="titleCab">
              <h1 class="textTitle">PRATICAGEM</h1>
              <h3 class="textTitle2">São Sebastião</h3>
              <p class="titleReport">Relatório de Horas Extras</p>
            </div>
            <h4>Data: ${hoje}</h4>
          </div>
        </header>
        <hr class="double">
        <div>
        ${dtIniFilter !== '' ? `<p>Periodo: ${dtIniFilter} à ${dtEndFilter}</p>` : ''}
        <table>
          <thead>
            <tr>
              <th>Data</th>
              <th>Horario de Inicio</th>
              <th>Horario de Encerramento</th>
              <th>Total de Horas</th>
            </tr>
          </thead>
          <tbody>
          ${dados.map( (lines, index) => ` 
          <tr style="border-bottom: 10px solid black; margin-top: 100px;">
            <td class="item" style="width: 25%">${lines.data}</td>
            <td class="item" style="width: 25%;">${lines.hrinicial}</td>
            <td class="item" style="width: 25%;">${lines.hrfinal}</td>
            <td class="item">${lines.hrtotal}</td>
          </tr>
          `,)
          .join('')
        } 
          </tbody>
        </table>
      </div>
      </body>
    </html>
    `
    try{
      const options = {
        html,
        fileName: 'OverTime',
        directory: 'Reports'
      }

      var file = await RNHTMLtoPDF.convert(options)
    }catch (erro){
      console.log('erro: '+erro.message)
    }
    const dir = file.filePath.substring(0, 66)
    if(!FileSystem.exists(dir)) {
      console.log("Diretorio não existe")
      return
    }
    setLoading(false)
    const granted = await PermissionsAndroid.request(
      PermissionsAndroid.PERMISSIONS.WRITE_EXTERNAL_STORAGE,PermissionsAndroid.PERMISSIONS.READ_EXTERNAL_STORAGE,
      {
        title: 'Permitir acesso ao armazenmento',
        message: 'Para gravação do PDF é preciso liberar o acesso ao armazenamento.',
        buttonNeutral: 'Pergunte-me depois',
        buttonNegative: 'Negar',
        buttonPositive: 'Permitir'
      }
    )
    if(granted === PermissionsAndroid.RESULTS.GRANTED) {
      await FileSystem.cpExternal(file.filePath, `HrExtras.pdf`, 'downloads')
      setLocalPath(file.filePath)
      setPdfView(true)
    }else console.log('falhou')
  }

  return(
    <View style={{flex: 1, alignItems: 'center', marginTop: 10}}>
      {loading ? 
        <Loading loading={loading} /> :
        pdfView ? 
          <View style={estilos.viewPDF}>
            <View style={estilos.viewCabPDF}>
              <TouchableOpacity
                onPress={()=>setPdfView(false)}
              >
                <Icon
                  name="arrow-back" 
                  size={25} 
                  color={'#333'}
                  style={{marginTop: 10, margin: 5}}
                />
              </TouchableOpacity>
              <Text style={estilos.textPDF}>VIZUALIZAÇÃO do PDF</Text>
            </View>
            <PDF 
              style={{flex: 1, width: Dimensions.get('window').width - 25, }}
              source={{uri: `file:${localPath}`}}
              onError={(error) => {
                console.log(error)
              }}
           />
          </View>
        :
        <View>
          <Text style={estilos.textCab}>Horas Extras</Text>
            <Text style={estilos.textGroup}>Periodo</Text>
            <View style={estilos.viewInputDate}>
            <MaskInput 
              style={estilos.inputDate}
              keyboardType="numeric"
              returnKeyType="next"
              value={dtIniFilter}
              onChangeText={(masked, unmasked) => {setDtIniFilter(masked)}}
              mask={Masks.DATE_DDMMYYYY}
              onSubmitEditing={() => dtIniFilter.length = 10 ? refDtend.current.focus() : ''}
              blurOnSubmit={false}
              onFocus={()=>setDtIniFilter('')}
              />
            <MaskInput 
              style={estilos.inputDate}
              keyboardType="numeric"
              value={dtEndFilter}
              onChangeText={(masked, unmasked) => {setDtEndFilter(masked)}}
              mask={Masks.DATE_DDMMYYYY}
              ref={refDtend}
              onFocus={()=>setDtEndFilter('')}
            />
          </View>
          <TouchableOpacity
            onPress={() => filtrar()}
            style={estilos.btn}
            >
            <Text style={estilos.textBtn}>Gerar Relatorio</Text>
          </TouchableOpacity>
        </View>
      }
    </View>
  )
}

const estilos = StyleSheet.create({
  viewPDF: {
    flex: 1, 
    justifyContent: 'center', 
    alignItems: 'center'
  },

  viewCabPDF: {
    flexDirection: 'row', 
    width: '100%',
    height: 50,
    alignItems: 'center',
    backgroundColor: '#ccc'
  },

  textPDF: {
    width: '90%',
    textAlign: 'center',
    fontSize: 25,
    fontWeight: 'bold',
    color: '#eee',
    textShadowColor: '#f00',
    textShadowOffset: {width: -2, height: 2},
    textShadowRadius: 10
  },

  viewInputDate: {
    flexDirection: 'row',
    width: 300,
    height: 100,
    backgroundColor: '#DDD',
    justifyContent: 'space-evenly',
    alignItems: 'center',
    borderRadius: 10
  },

  inputDate: {
    width: 130,
    height: 50,
    fontSize: 18,
    backgroundColor: '#fff',
    textAlign: 'center',
    borderRadius: 10
  },

  textGroup: {
    fontSize: 20,
    fontWeight: 'bold',
    marginTop: 20
  },

  btn: {
    backgroundColor: '#66CDAA',
    height: 50,
    borderRadius: 10,
    marginTop: 40,
    justifyContent: 'center',
    alignItems: 'center',
  },

  textBtn: {
    fontSize: 20,
    fontWeight: 'bold'
  },

  textCab: {
    fontSize: 24,
    fontWeight: 'bold',
    textAlign: 'center',
    textShadowColor: '#f00',
    textShadowRadius: 6
  }
})